package actividades;

public class Act13 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub //EJERCICIOS 13,14,15
		
		
		for (int a = 0; a <= 100; a = a+5) {
			System.out.println(a);
		}
		int b = 0;
		while (b <= 100) {
			System.out.println(b);
			b = b + 5;
		}
		int c = 0;
		do {
			System.out.println(c);
			c = c + 5;
		}while (c <= 100);
		
	}

}
